import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import AdminRouter from "./AdminRouter";

export default function BasicExample() {
    return (
        <Router>
            <AdminRouter/>
        </Router>
    );
}


function Dashboard() {
    return (
        <div>
        <h2>Dashboard</h2>
        </div>
    );
}

function NotFound() {
    return (
        <div>
        <h2>404 Not Found</h2>
        </div>
    );
}
